string-array.item:
Om din ficklampa inte fungerar kan den bero på följande orsaker:
- Ficklampan har stannat hela tiden, eventuellt eftersom strob-läget är på. Åtgärder för att stänga av stroboskt läge: Tillbaka till hemsidan → Kontrollera knappens läge under [SOS, 0 ~ 10] → Dra i knappen under nummer 0;
- Öppnade andra ficklampans applikationer eller kamerans applikation samtidigt, stänga dessa app;
- Tillåt inte kameratillstånd, fick ficklampan kamerabehörighet för att sätta på ljuset. Steg för att tillåta kameratillstånd: Tillbaka till hemsidan → Klicka på på / av-knappen → Tillåt kameratillstånd i popup-fönstret;
- Lampan på denna enhet är skadad. Du kan också använda skärmljus istället. Åtgärder för att använda skärmens ljus: Tillbaka till hemsidan → Klicka på skärmknappen i nedre högra hörnet.
